import React from "react";
import "./home.css";

import "./Styles.css";
function Home() {
  return (
    <div className="centered">
      <div className="homeContainer">
        <div className="homeGreets"></div>
        <div className="homeBooking">
          <h2 className="homeTitle">Book a table</h2>
          <form>
            <input className="bookName"></input>
            <input className="bookEmail"></input>
            <input className="bookPhone"></input>
            <input className="bookDate"></input>
            <input className="bookTime"></input>
            <button>book now</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Home;
